import React, {Component} from 'react';
import './Skills.css';

class Skills extends Component {

	render() {
		return (
			<div id={'skills'} className={'skills'}>
				<div className={'heading'}>
					<h1 className={'heading-text'}>Skills</h1>
				</div>
				<div className={'content'}>
					<p>Experienced Full Stack Engineer with a demonstrated history of working in the information technology and services industry. </p>
					<p>Skilled in PHP, JavaScript(jQuery), Java, Embedded Software Programming and Game Development. </p>
					<p>Strong engineering professional with a Bachelor's degree focused in Information Technology from College of Applied Technology Science Arandjelovac. </p>
				</div>
			</div>
		);
	}
}

export default Skills;
